webpackJsonp([0x70bae2c4180a],{500:function(a,n){a.exports={data:{site:{siteMetadata:{title:"React 🎄",author:"Michael Chan @chantastic"}},markdownRemark:{id:"/Users/chan/learnreact/react.holiday/src/pages/2017/15.md absPath of file >>> MarkdownRemark",html:'<div class="measure">\n<p><a href="/2017/14/">Yesterday</a>, you might have noticed this console warning pop up with our list.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/key-warning-562405fb6f1f6cdc076a5dc8d72c82d4-358cf.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 9.851551956815117%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAABQAAAACCAIAAADXZGvcAAAACXBIWXMAAAsSAAALEgHS3X78AAAAU0lEQVQI12NwFxZx5Bew5eE14+QCMoAkkG3JxW3BxW3GwWnDw2vOyWXCzgFk2PPxm3JwAkmglAMfvzE7B4M6AyNQwoFfwISD0wqs1IqbByhIDAIA6BsKh7f2dIIAAAAASUVORK5CYII=\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="react-unique-key-warning"\n        title=""\n        src="/static/key-warning-562405fb6f1f6cdc076a5dc8d72c82d4-42603.png"\n        srcset="/static/key-warning-562405fb6f1f6cdc076a5dc8d72c82d4-f931c.png 200w,\n/static/key-warning-562405fb6f1f6cdc076a5dc8d72c82d4-e8031.png 400w,\n/static/key-warning-562405fb6f1f6cdc076a5dc8d72c82d4-42603.png 800w,\n/static/key-warning-562405fb6f1f6cdc076a5dc8d72c82d4-5b8b9.png 1200w,\n/static/key-warning-562405fb6f1f6cdc076a5dc8d72c82d4-358cf.png 1482w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<h2>👶 Give the <code>children</code> keys 🔑</h2>\n<p>Following the warning above is simple but it leads some questions.</p>\n<p>Pass a unique <code>key</code> prop to each component in our <code>map()</code>.</p>\n<div class="gatsby-highlight">\n      <pre class="language-jsx"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span> <span class="token attr-name">key</span><span class="token script language-javascript"><span class="token punctuation">=</span><span class="token punctuation">{</span>someUniqueKey<span class="token punctuation">}</span></span><span class="token punctuation">></span></span><span class="token punctuation">{</span>ability<span class="token punctuation">.</span>ability<span class="token punctuation">.</span>name<span class="token punctuation">}</span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<h2>Why is this needed?</h2>\n<h4>👯‍♀️👯‍♂️ Teamwork!</h4>\n<p>With arrays, React needs assistance.</p>\n<p>To quickly and accurately identify changed, updated, or deleted items, React uses your provided <code>key</code> for diffing.</p>\n<h2>❄️ How unique is unique? ❄️</h2>\n<p>Keys need to be unique to that array.\n<code>id</code>s work great, if you got ‘em.</p>\n<p>Unfortunately, our <code>abilities</code> array doesn’t have <code>id</code>s.\nWe can use <code>ability.name</code> because we know each ability is only listed once per character.</p>\n<div class="gatsby-highlight">\n      <pre class="language-jsx"><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>li</span> <span class="token attr-name">key</span><span class="token script language-javascript"><span class="token punctuation">=</span><span class="token punctuation">{</span>ability<span class="token punctuation">.</span>ability<span class="token punctuation">.</span>name<span class="token punctuation">}</span></span><span class="token punctuation">></span></span>\n  <span class="token punctuation">{</span>ability<span class="token punctuation">.</span>ability<span class="token punctuation">.</span>name<span class="token punctuation">}</span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>li</span><span class="token punctuation">></span></span>\n</code></pre>\n      </div>\n<br />\n<p><em>(Again, <code>id</code> is preferred, when available.)</em></p>\n<h2>🙅‍♂️ There’s no <code>i</code> in team 👯‍♂️👯‍♀️</h2>\n<p>Avoid using the <code>map(item, i)</code> index.\nIt will make updates unpredictable.</p>\n<p>Disregard this warning (if you must) but know that this is a common place for tricky bugs to creep in.</p>\n<h2>Tinker with it</h2>\n<p>Use the workspace below and explore <code>keys</code>.</p>\n</div>\n<iframe src="https://codesandbox.io/embed/q3qkpoz02w" style="width:100%; height:500px; border:0; border-radius: 4px; overflow:hidden;" sandbox="allow-modals allow-forms allow-popups allow-scripts allow-same-origin"></iframe>',frontmatter:{title:"Day 15: Key your children",date:"December 15, 2017"}}},pathContext:{slug:"/2017/15/"}}}});
